import { Table } from 'antd';

const columns = [
  {
    title: 'Full Name',
    width: 100,
    dataIndex: 'name',
    key: 'name',
    fixed: 'left',
  },
  {
    title: 'Company',
    width: 100,
    dataIndex: 'company',
    key: 'company',
    fixed: 'left',
  },
  {
    title: 'Category',
    dataIndex: 'category',
    key: 'category',
    width: 100,
  },
  {
    title: 'Email',
    dataIndex: 'email',
    key: 'email',
    width: 150,
  },
  {
    title: 'Twitter',
    dataIndex: 'twitter',
    key: 'twitter',
    width: 150,
  },
  {
    title: 'LinkedIn',
    dataIndex: 'linkedin',
    key: 'linkedin',
    width: 150,
  },
  {
    title: 'Angel.co',
    dataIndex: 'angel',
    key: 'angel',
    width: 150,
  },
  {
    title: 'Crunchbase',
    dataIndex: 'crunchbase',
    key: 'crunchbase',
    width: 150,
  },
  { 
    title: 'Date Created',
    dataIndex: 'date_created',
    key: 'date_created' 
  },
  {
    title: 'Edit',
    key: 'operationEdit',
    fixed: 'right',
    width: 75,
    render: () => <button>Edit</button>,
  },
  {
    title: 'Delete',
    key: 'operationDelete',
    fixed: 'right',
    width: 100,
    render: () => <button>Delete</button>,
  }
];

const data = [];
for (let i = 0; i < 100; i++) {
  data.push({
    key: i,
    name: `Edward Coliglio ${i}`,
    company: 'Robert Half',
    category: 'Angel',
    email: `angelInvestor@angelInvestor.com`,
    
  });
}


const WithoutEmails=()=>{
  return(
    <Table
    columns={columns}
    dataSource={data}
    scroll={{ x: 1500 }}
    // summary={pageData => (
    //   <Table.Summary fixed>
    //     <Table.Summary.Row>
    //       <Table.Summary.Cell index={0} colSpan={2}>
    //         Fix Left
    //       </Table.Summary.Cell>
    //       <Table.Summary.Cell index={2} colSpan={8}>
    //         Scroll Context
    //       </Table.Summary.Cell>
    //       <Table.Summary.Cell index={10}>Fix Right</Table.Summary.Cell>
    //     </Table.Summary.Row>
    //   </Table.Summary>
    // )}
    sticky
  />
  )
}

export default WithoutEmails


